import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const ErrorPage = () => (
  <div>
    <h1>Oops, something went wrong.</h1>
    <p>
      Try{' '}
      <Link href='/'>
        <a>going back</a>
      </Link>
    </p>
  </div>
);

export default ErrorPage;
